  false,\n\t\"url\": null,\n\t\"notes\": \"Packet of information on conducting piping
  plover surveys in North Dakota for 1992. These surveys are part of a cooperative
  effort with other resource agencies and are coordinated with North Dakota Game and
  Fish Department. It contains a list of all cooperators in North Dakota and the sites
  that they have agreed to survey. The enclosed survey form is intended to help coordinate
  efforts among those surveying piping plover populations in North Dakota. It also
  is intended to standardize survey methods so that data is comparable between the
  site locations. The form may be utilized by those surveying either river or wetland
  habitats.  The reproductive success section provides information about the reproductive
  health of a population. This section is used if surveyors are able to visit sites
  regularly and can obtain information on numbers of nests hatched and juveniles fledged.
  Data for this section is to be obtained only when authorized by an endangered species
  subpermit to harass endangered species.  The Nest Characteristics section provides
  information about the condition of individual nest sites. Nest site characteristics
  should be documented only after all adults and juveniles leave the site (normally
  by late July).\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
